import { Card } from "react-bootstrap";

function Expcard(p) {
    return (<>

        <div className="col-md-4" >
            <Card style={{ height: "200px" }}>
                <Card.Body>
                    <p className="text-center">{p.date}</p>
                    <Card.Title className="text-center">Assistant Professor</Card.Title>

                    <Card.Text className="text-center">
                        {p.para}
                    </Card.Text>

                </Card.Body>
            </Card>

        </div>






    </>);
}

export default Expcard;
